import React, { Component } from 'react'

export default class logs extends Component {

    constructor(props){
        super(props);
    }

    redirect = () =>{
        this.propshistory.push("../")
    }

    render() {
        return (
            <div>
                <button id="searchpage" onClick={()=>this.redirect()}>Main Page</button>
            </div>
        )
    }
}
